import { useState } from "react";
import { Button, Card, CardBody, CardFooter, CardHeader, CardImg } from "react-bootstrap";

function NewsCard(props){
    return(
       <>
           <Card>
            <CardHeader>
                <h5 style={{fontFamily:"inherit"}}>{props.Title}</h5>
            </CardHeader>
            <CardImg variant="top">
                <img src={props.Image}/>
            </CardImg>
            <CardBody>
                <p>
                    {props.Description}
                </p>
            </CardBody>
            <CardFooter>
                <Button variant="primary" href={props.url}></Button>
            </CardFooter>
          </Card>
       </>
    );
}

export default NewsCard;
